subSubSection.paragraph:
Remarks.

Selymbria pluvialis

can be distinguished quickly from 

S. ahyetios

by the spot of infuscation on the apex of the fore wing. This species emerges when the rains begin and is active during the early and mid-rainy season between late April and mid-September and tends to fly at higher altitudes in the forest based on the majority being captured in the canopy trap (
Ramos & Wolda 1985
; 
Wolda 1977
; 
1988
; 
1989
).
